import React from "react";
import Home from "../component/home";
import Detail from "../component/poll_detail/index";
import Poll from "../component/poll_list/index";
import Addpoll from "../component/add/index";

const router = [
  {
    path: "/",
    exact: true,
    main: () => <Home></Home>,
  },
  {
    path: "/poll",
    exact: false,
    main: (history) => <Poll history={history}></Poll>,
  },

  {
    path: "/polldetail/:id",
    exact: false,
    main: (match) => <Detail match={match}></Detail>,
  },
];

export default router;
